        //     email: this.state.email,
        //     password: this.state.password
        // })
        //     .then(function (response) {
        //         console.log(response);
        //     })
        //     .catch(function (error) {
        //         console.log(error);
        //     });
        console.log("loging by:" + this.state.email);
    }
    handleEmailChange(e) {
        this.setState({ email: e.target.value })
    }
    handlePasswordChange(e) {
        this.setState({ password: e.target.value })
    }
    validateForm() {
        return this.state.email.length > 0 && this.state.password.length > 0;
    }
    onClick(e) {
        return;
        // debugger;
        // console.log(this.state.email)
    }



    render() {
        // onClick: function(){
        //     console.log(this.state.email)
        // }
        return (
            <div id="idoFormLogin">

                <form >
                    <label><b>Username</b></label>
                    <input type="text" onChange={this.handleEmailChange} placeholder="Enter Username" />
                    <label><b>Password</b></label>
                    <input type="password" onChange={this.handlePasswordChange} placeholder="Enter Password" />
                    {/* <Link to="/to-do" > */}
                        <button onClick={this.signIn} disabled={!this.validateForm()}>
                            Sign in...
                        </button>
                    {/* </Link> */}
                </form>
            </div>

        )
    }
}

class ToDo extends React.Component {
    render() {
        return (
            <div>
                To do list Here
            </div>
        )
    }
}


export default App;
